local sb = ""

local function s(any)
    local t = type(any)
    if t == "string" then
        return '"' .. any .. '"'
    end
    if t == "number" then
        if math.floor(any) == any then
            return tostring(any)
        else
            return any .. "f"
        end
    end
    if t == "boolean" then
        if any then
            return "true"
        else
            return "false"
        end
    end
    return tostring(any)
end

local function t_count(t)
    local count = 0
    for _, _ in pairs(t) do
        count = count + 1
    end
    return count
end

for _, e in pairs(Effect) do
    sb = sb .. 'effect = CreateInstance<Effect>();\n'
    sb = sb .. 'effect.SheetCategory = "'..e.SheetCategory..'";\n'
    sb = sb .. 'effect.ID = '..e.ID..';\n'
    sb = sb .. 'effect.Desc = "'..e.Desc..'";\n'
    sb = sb .. 'effect.Type = (Effect.TEffectType)('..e.Type..');\n'
    sb = sb .. 'effect.TargetType = (Effect.TTargetType)('..e.TargetType..');\n'
    sb = sb .. 'effect.SubType = (Effect.TEffectSubType)('..e.SubType..');\n'
    sb = sb .. 'effect.AttackType = (Effect.TAttackType)('..e.AttackType..');\n'
    sb = sb .. 'tab = new Table();\n'
    for key, value in pairs(e.Attributes) do
        sb = sb .. 'tab.Set('..key..', '..s(value)..');\n'
    end
    sb = sb .. 'effect.Attributes = tab;\n'
    sb = sb .. 'effect.CondType = (Effect.TConditionType)('..e.CondType..');\n'
    sb = sb .. 'effect.CondParam = "'..e.CondParam..'";\n'
    local listSize = t_count(e.ExtraList)
    sb = sb .. 'intList = new int['..listSize..'];\n'
    for i = 0, listSize - 1 do
        sb = sb .. 'intList['..i..'] = '..e.ExtraList[i+1]..';\n'
    end
    sb = sb .. 'effect.ExtraList = intList;\n'
    sb = sb .. 'tab2 = new Table();\n'
    for key, value in pairs(e.ExtraData) do
        sb = sb .. 'tab2.Set("'..key..'", '..s(value)..');\n'
    end
    sb = sb .. 'effect.ExtraData = tab2;\n'
    sb = sb .. 'effect.SubValue = "'..e.SubValue..'";\n'
    sb = sb .. 'effect.PositionType = (Effect.TPositionType)('..e.PositionType..');\n'
    sb = sb .. 'effect.Coefficient = '..e.Coefficient..';\n'
    sb = sb .. 'effect.HitBack = '..e.HitBack..';\n'
    sb = sb .. 'effect.HitStrong = '..e.HitStrong..';\n'
    sb = sb .. 'effect.Prop = '..e.Prop..';\n'
    sb = sb .. 'effect.CD = '..e.CD..';\n'
    sb = sb .. 'effect.Animation = "'..e.Animation..'";\n'
    sb = sb .. 'effect.HangingPoint = "'..e.HangingPoint..'";\n'
    sb = sb .. 'effect.Sound = "'..e.Sound..'";\n'
    sb = sb .. 'AssetDatabase.CreateAsset(effect, "Assets/Editor/GameConfig/Effects/'..e.ID..'.asset");\n'
end

print(sb)
